import React from 'react';
import { Box, Card, Heading, Text } from 'rebass'

const Post = ({ posts }) => {
  posts = posts.slice(0,50);

  const post = posts.map((post, index) =>
    <Card key={post.id} className={"posts__item"}>
      <h2 className={"posts__header"}>
        {post.title}
      </h2>
      <Text className={"posts__text"}>
        {post.body}
      </Text>
    </Card>
  );

  return (
    <Box className={"posts"}>
      {post}
    </Box>
  )
};

export default Post
